class AbacusComponent {
    constructor(exerciseDataService) {
        this.exerciseDataService = exerciseDataService;
    }
    ngOnChanges() {
        this.list.sort((a, b) => {
            return a.Order - b.Order;
        });
        if (this.isCorrectValues) {
            this.list.forEach((data) => {
                this.abacusArray[data.Order - 1].balls.length = +data.CorrectValue;
                this.abacusArray[data.Order - 1].IsCorrect = data.IsCorrect;
            });
            return;
        }
        let NumberOfRods;
        const result = [];
        const devaultValues = [];
        const defaultLetters = {
            3: ['C', 'D', 'U'],
            6: ['C', 'D', 'U', 'C', 'D', 'U'],
            9: ['C', 'D', 'U', 'C', 'D', 'U', 'C', 'D', 'U'],
        };
        this.list.forEach(data => {
            if (data.Metric === 'NumberOfRods') {
                NumberOfRods = data.Value;
                this.defaultLetters = defaultLetters[data.Value];
            }
            if (data.Metric === 'Label') {
                this.Label = data.Value;
            }
            if (data.Metric === 'Editable') {
                this.Editable = data.Value === 'True' ? true : false;
            }
            if (data.Metric === 'DefaultValue') {
                const item = { Order: data.Order, Value: data.Value };
                devaultValues.push(item);
            }
        });
        while (NumberOfRods > 0) {
            const item = { balls: [], IsCorrect: null };
            result.push(item);
            NumberOfRods--;
        }
        if (devaultValues.length) {
            devaultValues.forEach(data => {
                result[data.Order - 1].balls.length = +data.Value;
            });
        }
        this.abacusArray = result;
    }
    getUserResult(value, order) {
        const body = {
            Type: 'Abacus',
            Order: this.Order,
            Data: { Order: order + 1, Value: value }
        };
        this.exerciseDataService.subject.next(body);
    }
    addBall(i) {
        if (!this.Editable) {
            return;
        }
        this.abacusArray[i].balls.push(null);
        if (this.abacusArray[i].balls.length > 9) {
            this.abacusArray[i].balls = [];
        }
        this.abacusArray.forEach((data, order) => {
            if (!data.balls.length) {
                this.getUserResult('0', order);
            }
            else {
                this.getUserResult(data.balls.length + '', order);
            }
        });
    }
}


