class ComparisonComponent {
    constructor(exerciseDataService) {
        this.exerciseDataService = exerciseDataService;
        this.selectedItem = [];
    }
    ngOnChanges() {
        this.list.sort((a, b) => {
            return a.Order - b.Order;
        });
        if (this.isCorrectValues) {
            this.list.forEach((data) => {
                this.selectedItem[data.Order] = data.CorrectValue;
                this.options.forEach(e => {
                    if (e.Order === data.Order) {
                        e.IsCorrect = data.IsCorrect;
                    }
                });
            });
            return;
        }
        const options = [];
        const sortOptionsValue = {};
        this.list.forEach(data => {
            if (data.Metric === 'Option') {
                if (!sortOptionsValue[data.Order]) {
                    sortOptionsValue[data.Order] = { Type: 'Option', Order: data.Order, ValueList: [], CorrectValue: null, IsCorrect: null };
                    sortOptionsValue[data.Order].ValueList.push(data.Value);
                    options.push(sortOptionsValue[data.Order]);
                }
                else {
                    sortOptionsValue[data.Order].ValueList.push(data.Value);
                }
            }
            if (data.Metric === 'Text') {
                options.push({ Value: data.Value, Order: data.Order, Type: 'Text' });
            }
        });
        this.options = options;
    }
    getUserResult(value, order) {
        const body = {
            Type: 'Comparison',
            Order: this.Order,
            Data: { Order: order, Value: value }
        };
        this.exerciseDataService.subject.next(body);
    }
}


