class ComplexNumberDecompositionComponent {
    constructor(exerciseDataService) {
        this.exerciseDataService = exerciseDataService;
        this.lineWidth = ['19%', '25%', '31%', '37%', '43%', '49%'];
        this.lineHeight = [];
    }
    ngOnChanges() {
        this.list.sort((a, b) => {
            return a.Order - b.Order;
        });
        if (this.isCorrectValues) {
            this.list.forEach((data) => {
                this.numberDecompositionLeftList.forEach(leftItem => {
                    if (leftItem.leftOrder === data.Order) {
                        leftItem.leftCorrectValue = data.CorrectValue;
                        leftItem.leftIsCorrect = data.IsCorrect;
                    }
                });
                this.numberDecompositionRightList.forEach(rightItem => {
                    if (rightItem.rightOrder === data.Order) {
                        rightItem.rightCorrectValue = data.CorrectValue;
                        rightItem.rightIsCorrect = data.IsCorrect;
                    }
                });
            });
            return;
        }
        let num;
        const defaultValues = [];
        const leftResult = [];
        const rightResult = [];
        this.list.forEach(data => {
            if (data.Metric === 'Number') {
                num = data.Value.split('');
            }
            if (data.Metric === 'DefaultValue') {
                const item = { Order: data.Order, DefaultValue: data.Value };
                defaultValues.push(item);
            }
        });
        let rightOrderCount = num.length;
        let leftOrderCount = 0;
        num.reverse().forEach((str, i) => {
            const item = {
                leftDefaultValue: null, rightDefaultValue: null,
                leftCorrectValue: null, rightCorrectValue: null,
                leftIsCorrect: null, rightIsCorrect: null,
                Value: str, leftOrder: ++leftOrderCount, rightOrder: null
            };
            leftResult.push(item);
            if (i > 0) {
                item.rightOrder = ++rightOrderCount;
                rightResult.push(item);
            }
        });
        if (defaultValues.length) {
            defaultValues.forEach(data => {
                leftResult.forEach(leftItem => {
                    if (leftItem.leftOrder === data.Order) {
                        leftItem.leftDefaultValue = data.DefaultValue;
                    }
                });
                rightResult.forEach(rightItem => {
                    if (rightItem.rightOrder === data.Order) {
                        rightItem.rightDefaultValue = data.DefaultValue;
                    }
                });
            });
        }
        this.numberDecompositionLeftList = leftResult;
        this.numberDecompositionRightList = rightResult;
    }
    ngAfterViewInit() {
        setTimeout(() => {
            const elem = document.getElementsByClassName('item-wrapper');
            const top = elem[0].getBoundingClientRect().top;
            Array.from(elem).forEach((item) => {
                const itemTop = item.getBoundingClientRect().top;
                this.lineHeight.push(itemTop - top + 'px');
            });
        }, 0);
    }
    getUserResult(value, order) {
        const body = {
            Type: 'ComplexNumberDecomposition',
            Order: this.Order,
            Data: { Order: order, Value: value }
        };
        this.exerciseDataService.subject.next(body);
    }
    isIcon(input) {
        if (input.value) {
            input.classList.remove('form_input-edit-icon');
        }
        else {
            input.classList.add('form_input-edit-icon');
        }
    }
}


