class FillInputsComponent {
    constructor(exerciseDataService) {
        this.exerciseDataService = exerciseDataService;
    }
    ngOnChanges() {
        const result = [];
        this.list.sort((a, b) => {
            return a.Order - b.Order;
        });
        if (this.isCorrectValues) {
            this.list.forEach((e, i) => {
                this.fillInputsArray[i].CorrectValue = e.CorrectValue;
                this.fillInputsArray[i].IsCorrect = e.IsCorrect;
            });
            return;
        }
        this.list.forEach(e => {
            const item = {
                CorrectValue: null,
                IsCorrect: null,
                letter: e
            };
            result.push(item);
        });
        this.fillInputsArray = result;
    }
    getUserResult(value, i) {
        const body = {
            Type: 'Fill Inputs',
            Order: this.Order,
            Data: { Order: i + 1, Value: value }
        };
        this.exerciseDataService.subject.next(body);
    }
    isIcon(input) {
        if (input.value) {
            input.classList.remove('form_input-edit-icon');
        }
        else {
            input.classList.add('form_input-edit-icon');
        }
    }
}


