class ImageSwapComponent {
    constructor(resourceLoadsService, exerciseDataService) {
        this.resourceLoadsService = resourceLoadsService;
        this.exerciseDataService = exerciseDataService;
        this.savePrice = {};
    }
    ngOnChanges() {
        this.list.sort((a, b) => {
            return a.Order - b.Order;
        });
        if (this.isCorrectValues) {
            const correctResult = [];
            this.list.forEach((data) => {
                const correctItem = { img: data.CorrectValue, value: this.savePrice[data.CorrectValue], IsCorrect: data.IsCorrect };
                correctResult.push(correctItem);
            });
            this.ImageSwapArray = correctResult;
            return;
        }
        const result = [];
        let image;
        this.list.forEach(e => {
            if (e.Metric === 'ImageName') {
                image = e.Value;
            }
            if (e.Metric === 'Value') {
                const item = { img: image, value: e.Value, IsCorrect: null };
                this.savePrice[image] = e.Value;
                result.push(item);
            }
        });
        this.ImageSwapArray = result;
    }
    moveRight(i) {
        const images = document.getElementsByClassName('image-swap-card');
        images[i].classList.add('move-right');
        images[i].classList.add('z-index');
        images[i + 1].classList.add('move-left');
        const saveItemOne = this.ImageSwapArray[i];
        const saveItemTwo = this.ImageSwapArray[i + 1];
        setTimeout(() => {
            images[i].classList.remove('move-right');
            images[i].classList.remove('z-index');
            images[i + 1].classList.remove('move-left');
            this.ImageSwapArray[i] = saveItemTwo;
            this.ImageSwapArray[i + 1] = saveItemOne;
            this.getresults();
        }, 600);
    }
    moveLeft(i) {
        const images = document.getElementsByClassName('image-swap-card');
        images[i].classList.add('move-left');
        images[i - 1].classList.add('move-right');
        const saveItemOne = this.ImageSwapArray[i];
        const saveItemTwo = this.ImageSwapArray[i - 1];
        setTimeout(() => {
            images[i].classList.remove('move-left');
            images[i - 1].classList.remove('move-right');
            this.ImageSwapArray[i] = saveItemTwo;
            this.ImageSwapArray[i - 1] = saveItemOne;
            this.getresults();
        }, 600);
    }
    getresults() {
        this.ImageSwapArray.forEach((data, i) => {
            data.order = i + 1;
            this.getUserResult(data.img, data.order);
        });
    }
    getUserResult(value, order) {
        const body = {
            Type: 'ImageSwap',
            Order: this.Order,
            Data: { Order: order, Value: value }
        };
        this.exerciseDataService.subject.next(body);
    }
}


