class InputsOnSentenceComponent {
    constructor(exerciseDataService) {
        this.exerciseDataService = exerciseDataService;
    }
    ngOnChanges() {
        this.list.sort((a, b) => {
            return a.Order - b.Order;
        });
        if (this.isCorrectValues) {
            this.list.forEach((data) => {
                this.InputsOnSentenceArray[data.Order - 1].CorrectValue = data.CorrectValue;
                this.InputsOnSentenceArray[data.Order - 1].IsCorrect = data.IsCorrect;
            });
            return;
        }
        const result = [];
        this.list.forEach(data => {
            const item = { Order: data.Order, Type: data.Metric, Value: data.Value || null, CorrectValue: null, IsCorrect: null };
            result.push(item);
        });
        this.InputsOnSentenceArray = result;
    }
    getUserResult(value, order) {
        const body = {
            Type: 'InputsOnSentence',
            Order: this.Order,
            Data: { Order: order, Value: value }
        };
        this.exerciseDataService.subject.next(body);
    }
    isIcon(input) {
        if (input.value) {
            input.classList.remove('form_input-edit-icon');
        }
        else {
            input.classList.add('form_input-edit-icon');
        }
    }
}


