class MultipleChoicesComponent {
    constructor(exerciseDataService) {
        this.exerciseDataService = exerciseDataService;
        this.userResultObj = {};
    }
    ngOnChanges() {
        this.list.sort((a, b) => {
            return a.Order - b.Order;
        });
        if (this.isCorrectValues && !this.HasMultipleAnswer) {
            const correctValue = {
                value: null,
                IsCorrect: null
            };
            this.multiChoiseList.forEach((data, i) => {
                if (this.list[i]) {
                    correctValue.value = this.list[i].CorrectValue;
                    correctValue.IsCorrect = this.list[i].IsCorrect;
                }
                if (typeof this.saveI === 'number' && data.value === correctValue.value) {
                    data.correctValue.value = true;
                    data.correctValue.IsCorrect = true;
                    return;
                }
                if (typeof this.saveI === 'number' && this.multiChoiseList[this.saveI].value !== correctValue.value) {
                    this.multiChoiseList[this.saveI].correctValue.IsCorrect = false;
                    this.multiChoiseList[this.saveI].isActive = false;
                    return;
                }
                if (typeof this.saveI !== 'number' && data.value === correctValue.value) {
                    data.correctValue.value = false;
                    data.correctValue.IsCorrect = false;
                    this.saveI = null;
                    return;
                }
            });
            return;
        }
        if (this.isCorrectValues && this.HasMultipleAnswer) {
            this.multiChoiseList.forEach((data, i) => {
                this.list.forEach(item => {
                    if (!this.userResultObj[i] && item.CorrectValue === data.value) {
                        data.correctValue.IsCorrect = false;
                    }
                    if (this.userResultObj[i] && item.CorrectValue === this.userResultObj[i]) {
                        data.correctValue.IsCorrect = true;
                    }
                });
            });
            return;
        }
        const result = [];
        this.list.forEach(data => {
            const item = { value: data, isActive: false, correctValue: { value: null, IsCorrect: null } };
            result.push(item);
        });
        this.multiChoiseList = result;
    }
    choise(i) {
        if (this.HasMultipleAnswer) {
            this.multiChoiseList[i].isActive = !this.multiChoiseList[i].isActive;
            this.multiChoiseList[i].isActive ? this.userResultObj[i] = this.list[i] : delete this.userResultObj[i];
            let count = 0;
            for (const key in this.userResultObj) {
                if (this.userResultObj.hasOwnProperty(key)) {
                    this.getUserResult(this.userResultObj[key], ++count);
                }
            }
            return;
        }
        else {
            if (typeof this.saveI === 'number') {
                this.multiChoiseList[this.saveI].isActive = false;
            }
            this.saveI = i;
            this.multiChoiseList[i].isActive = !this.multiChoiseList[i].isActive;
            this.userResultObj = {};
            this.userResultObj[i] = this.list[i];
            this.getUserResult(this.userResultObj[i], 1);
        }
    }
    getUserResult(value, order) {
        const body = {
            Type: 'Multiple Choices',
            Order: this.Order,
            Data: { Order: order, Value: value }
        };
        return this.exerciseDataService.subject.next(body);
    }
}


