class NumberCariageComponent {
    constructor(exerciseDataService) {
        this.exerciseDataService = exerciseDataService;
    }
    ngOnChanges() {
        this.list.sort((a, b) => {
            return a.Order - b.Order;
        });
        let trainCars;
        const defaultValues = [];
        const result = [];
        if (this.isCorrectValues) {
            this.list.forEach((data) => {
                if (data.Order <= 3) {
                    this.numberCariageArray[0][data.Order - 1].CorrectValue = data.CorrectValue;
                    this.numberCariageArray[0][data.Order - 1].IsCorrect = data.IsCorrect;
                }
                if (data.Order > 3 && data.Order <= 6) {
                    this.numberCariageArray[1][data.Order - 4].CorrectValue = data.CorrectValue;
                    this.numberCariageArray[1][data.Order - 4].IsCorrect = data.IsCorrect;
                }
                if (data.Order > 6) {
                    this.numberCariageArray[2][data.Order - 7].CorrectValue = data.CorrectValue;
                    this.numberCariageArray[2][data.Order - 7].IsCorrect = data.IsCorrect;
                }
            });
            return;
        }
        this.list.forEach(data => {
            if (data.Metric === 'NumberOfCariages') {
                trainCars = data.Value;
            }
            if (data.Metric === 'DefaultValue') {
                const item = { Order: data.Order, Value: data.Value };
                defaultValues.push(item);
            }
        });
        let count = 0;
        while (trainCars > 0) {
            const resultitem = [];
            ['C', 'D', 'U'].forEach(letter => {
                const item = { defaultValue: null, CorrectValue: null, IsCorrect: null, Letter: letter, order: ++count };
                resultitem.push(item);
            });
            result.push(resultitem);
            trainCars--;
        }
        if (defaultValues.length) {
            defaultValues.forEach(data => {
                if (data.Order <= 3) {
                    result[0][data.Order - 1].defaultValue = data.Value;
                }
                if (data.Order > 3 && data.Order <= 6) {
                    result[1][data.Order - 4].defaultValue = data.Value;
                }
                if (data.Order > 6) {
                    result[2][data.Order - 7].defaultValue = data.Value;
                }
            });
        }
        this.numberCariageArray = result;
    }
    getUserResult(value, order) {
        const body = {
            Type: 'NumberCariage',
            Order: this.Order,
            Data: { Order: order, Value: value }
        };
        this.exerciseDataService.subject.next(body);
    }
    oneLetter(elem) {
        if (elem.value.length) {
            elem.value = elem.value[elem.value.length - 1];
        }
    }
}


