class ScaledNumberLineComponent {
    constructor() {
        this.points = {};
    }
    ngAfterContentInit() {
        let NumberOfSteps;
        let MinValue;
        let MaxValue;
        const scaledList = [];
        this.list.sort((a, b) => {
            return a.Order - b.Order;
        });
        this.list.forEach(data => {
            if (data.Metric === 'NumberOfSteps') {
                NumberOfSteps = data.Value;
                let i = 0;
                while (i < +NumberOfSteps) {
                    scaledList.push(i);
                    i++;
                }
                scaledList.push(i);
            }
            if (data.Metric === 'MinValue') {
                MinValue = data.Value;
            }
            if (data.Metric === 'MaxValue') {
                MaxValue = data.Value;
            }
            if (data.Metric === 'Title') {
                this.Title = data.Value;
            }
            if (data.Metric === 'Label: Value') {
                const point = +data.Value.slice(data.Value.indexOf(':') + 1); // get number value
                const val = point - +MinValue; // now point start from zero
                const p = scaledList.length / (+MaxValue - +MinValue); // percent length of lines
                this.points[Math.floor(p * val)] = { value: data.Value.slice(0, data.Value.indexOf(':')), position: p * val };
            }
        });
        this.scaledList = scaledList;
    }
    getPosition(point) {
        const str = point + '';
        const y = str.slice(str.indexOf('.') + 1, str.indexOf('.') + 2); // get number after '.'
        const z = +y * 12;
        return -60 + z; // 60% is transform point in css
    }
}


