class SimpleTableComponent {
    constructor(exerciseDataService) {
        this.exerciseDataService = exerciseDataService;
        this.tableWidth = {
            1: '35%',
            2: '35%',
            3: '55%',
            4: '77%'
        };
        this.tableArray = [];
        this.rowsArrows = [];
    }
    ngOnChanges() {
        this.list.sort((a, b) => {
            return a.Order - b.Order;
        });
        if (this.isCorrectValues) {
            this.list.forEach((data) => {
                data.Order--;
                const correctValue = {
                    row: null,
                    column: null
                };
                if (data.Order / this.saveColumns < 1) {
                    correctValue.row = 0;
                    correctValue.column = data.Order;
                }
                else {
                    correctValue.row = Math.floor(data.Order / this.saveColumns);
                    correctValue.column = (data.Order - (correctValue.row * (this.saveColumns)));
                }
                try {
                    this.tableArray[correctValue.row][correctValue.column].CorrectValue = data.CorrectValue;
                    this.tableArray[correctValue.row][correctValue.column].IsCorrect = data.IsCorrect;
                }
                catch (error) {
                    alert('Error: Correct value Order > columns quantity or < 1');
                }
            });
            return;
        }
        let columns;
        let rows;
        const DefaultValue = [];
        const resultArray = [];
        this.list.forEach(e => {
            if (e.Metric === 'ColumnSize') {
                columns = e.Value;
            }
            if (e.Metric === 'RowSize') {
                rows = e.Value;
            }
            if (e.Metric === 'DefaultValue') {
                --e.Order;
                DefaultValue.push(e);
            }
        });
        let count = 0;
        const saveColumns = columns;
        this.saveColumns = saveColumns;
        let order = 0;
        while (rows > 0) {
            const columnsArray = [];
            while (columns > 0) {
                const obj = { defaultValue: null, CorrectValue: null, IsCorrect: null, Order: ++order };
                if (rows === 1) {
                    count++;
                }
                columnsArray.push(obj);
                columns--;
            }
            resultArray.push(columnsArray);
            columns = saveColumns;
            rows--;
        }
        const defaultValue = {
            row: null,
            column: null
        };
        DefaultValue.forEach(data => {
            if (data.Order / saveColumns < 1) {
                defaultValue.row = 0;
                defaultValue.column = data.Order;
            }
            else {
                defaultValue.row = Math.floor(data.Order / saveColumns);
                defaultValue.column = (data.Order - (defaultValue.row * (saveColumns)));
            }
            try {
                resultArray[defaultValue.row][defaultValue.column].defaultValue = data.Value;
            }
            catch (error) {
                alert('Error: Order Default Value > columns quantity or < 1');
            }
        });
        this.tableArray = resultArray;
        setTimeout(() => {
            if (this.tableWidth.hasOwnProperty(columns)) {
                this.table.nativeElement.style.width = this.tableWidth[columns];
            }
            if (columns < 5) {
                this.table.nativeElement.style.margin = 'auto';
            }
        }, 0);
    }
    getUserResult(value, order) {
        const body = {
            Type: 'SimpleTable',
            Order: this.Order,
            Data: { Order: order, Value: value }
        };
        this.exerciseDataService.subject.next(body);
    }
    isIcon(input) {
        if (input.value) {
            input.classList.remove('form_input-edit-icon');
        }
        else {
            input.classList.add('form_input-edit-icon');
        }
    }
}


