            let randomColumn = this.getRandomInt(1, 6) - 1;
            if (!resultArray[randomRow][randomColumn]) {
                resultArray[randomRow][randomColumn] = element;
            }
            else {
                let x = true;
                while (x) {
                    randomRow = this.getRandomInt(1, 6) - 1;
                    randomColumn = this.getRandomInt(1, 6) - 1;
                    if (!resultArray[randomRow][randomColumn]) {
                        resultArray[randomRow][randomColumn] = element;
                        x = false;
                    }
                }
            }
