class UpperChainComponent {
    constructor(exerciseDataService) {
        this.exerciseDataService = exerciseDataService;
        this.upperChainList = [];
        this.classes = ['square', 'rhombus', 'triangle', 'circle'];
    }
    ngOnChanges() {
        this.list.sort((a, b) => {
            return a.Order - b.Order;
        });
        if (this.isCorrectValues) {
            this.list.forEach((e, i) => {
                e.Order--;
                this.upperChainList[e.Order].CorrectValue = e.CorrectValue;
                this.upperChainList[e.Order].IsCorrect = e.IsCorrect;
            });
            return;
        }
        const DefaultValue = [];
        const StepLegendNumber = [];
        const LegendValue = [];
        const resultArray = [];
        this.list.forEach(e => {
            if (e.Metric === 'DefaultValue') {
                DefaultValue.push(e);
            }
            if (e.Metric === 'LegendValue') {
                LegendValue.push(e);
            }
            if (e.Metric === 'StepLegendNumber') {
                StepLegendNumber.push(e);
            }
        });
        LegendValue.sort((a, b) => {
            return a.Order - b.Order;
        });
        this.LegendValue = LegendValue;
        StepLegendNumber.sort((a, b) => {
            return a.Order - b.Order;
        });
        // get unique array classes
        const resultClasses = [];
        LegendValue.forEach(e => {
            resultClasses.push(this.classes[this.getRandomClass()]);
        });
        while (this.unique(resultClasses).length) {
            this.unique(resultClasses).forEach(i => {
                resultClasses[i] = this.classes[this.getRandomClass()];
            });
        }
        this.resultClasses = resultClasses;
        // /get unique array classes
        let position = 2;
        const step = 12;
        const legend = [];
        StepLegendNumber.forEach(data => {
            legend.push(+data.Value - 1);
            const elem = {
                position: position + 'vw',
                class: resultClasses[+data.Value - 1], defaultValue: null, CorrectValue: null, IsCorrect: null
            };
            resultArray.push(elem);
            position += step;
        });
        resultArray.push({ position: position + 'vw', class: null, defaultValue: null, CorrectValue: null, IsCorrect: null });
        DefaultValue.forEach(data => {
            try {
                resultArray[+data.Order - 1].defaultValue = data.Value;
            }
            catch (error) {
                alert('Error: Order default value > Steps or < 1');
            }
        });
        this.upperChainList = resultArray;
    }
    getUserResult(value, i) {
        const body = {
            Type: 'UpperChain',
            Order: this.Order,
            Data: { Order: i + 1, Value: value }
        };
        this.exerciseDataService.subject.next(body);
    }
    isIcon(input) {
        if (input.value) {
            input.classList.remove('form_input-edit-icon');
        }
        else {
            input.classList.add('form_input-edit-icon');
        }
    }
    getRandomClass() {
        const rand = 0 - 0.5 + Math.random() * (12 - 0 + 1);
        const result = Math.round(rand);
        if (result <= 3) {
            return 0;
        }
        if (result > 3 && result <= 6) {
            return 1;
        }
        if (result > 6 && result <= 9) {
            return 2;
        }
        if (result > 9) {
            return 3;
        }
    }
    unique(arr) {
        const result = [];
        const notUnique = [];
        arr.forEach((str, i) => {
            if (!result.includes(str)) {
                result.push(str);
            }
            else {
                notUnique.push(i);
            }
        });
        return notUnique;
    }
}


